import Link from 'next/link'

const Homepage = () => {

    const peoples = [
        { v: 'person', name: 'John' },
        { v: 'person', name: 'Doe' },
        { v: 'person', name: 'Traversy' }
    ]

    return <div>
        <h1> Hello World! </h1>
        {
            peoples.map(e => (
                <Link as="" href="[persons]/[person]">
                    <a>Person</a>
                </Link>
            ))
        }
    </div>
}

export default Homepage
